        const products = this.props.posts;
        let x=''
        if(products!= undefined && products !=''){
            x =(
                products.map(pd=>(
                    <ProductCard
                                          id={pd.product_id}
                                          image={pd.product_image}
                                          title={pd.product_name}
                                          price={pd.product_cost}
                                          rating={pd.product_rating}
                                        />
                ))
            )
